a1e7cc8\",\"elType\":\"widget\",\"settings\":{\"title\":\"Pol\\u00edtica Privacidade                    A sua privacidade \\u00e9 importante para n\\u00f3s. \\u00c9 pol\\u00edtica do https:\\/\\/oportunidadesonline.online\\/ respeitar a sua privacidade em rela\\u00e7\\u00e3o a qualquer informa\\u00e7\\u00e3o sua que possamos coletar no site https:\\/\\/oportunidadesonline.online\\/, e outros sites que possu\\u00edmos e operamos.                    Solicitamos informa\\u00e7\\u00f5es pessoais apenas quando realmente precisamos delas para lhe fornecer um servi\\u00e7o. Fazemo-lo por meios justos e legais, com o seu conhecimento e consentimento. Tamb\\u00e9m informamos por que estamos coletando e como ser\\u00e1 usado.                                        Apenas retemos as informa\\u00e7\\u00f5es coletadas pelo tempo necess\\u00e1rio para fornecer o servi\\u00e7o solicitado. Quando armazenamos dados, protegemos dentro de meios comercialmente aceit\\u00e1veis \\u200b\\u200bpara evitar perdas e roubos, bem como acesso, divulga\\u00e7\\u00e3o, c\\u00f3pia, uso ou                        modifica\\u00e7\\u00e3o n\\u00e3o autorizados.                    N\\u00e3o compartilhamos informa\\u00e7\\u00f5es de identifica\\u00e7\\u00e3o pessoal publicamente ou com terceiros, exceto quando exigido por lei.                    O nosso site pode ter links para sites externos que n\\u00e3o s\\u00e3o operados por n\\u00f3s. Esteja ciente de que n\\u00e3o temos controle sobre o conte\\u00fado e pr\\u00e1ticas desses sites e n\\u00e3o podemos aceitar responsabilidade por suas respectivas pol\\u00edticas de privacidade.                                        Voc\\u00ea \\u00e9 livre para recusar a nossa solicita\\u00e7\\u00e3o de informa\\u00e7\\u00f5es pessoais, entendendo que talvez n\\u00e3o possamos fornecer alguns dos servi\\u00e7os desejados.                    O uso continuado de nosso site ser\\u00e1 considerado como aceita\\u00e7\\u00e3o de nossas pr\\u00e1ticas em torno de privacidade e informa\\u00e7\\u00f5es pessoais. Se voc\\u00ea tiver alguma d\\u00favida sobre como lidamos com dados do usu\\u00e1rio e informa\\u00e7\\u00f5es pessoais, entre em contacto connosco.                    Pol\\u00edtica de Cookies https:\\/\\/oportunidadesonline.online\\/                    O que s\\u00e3o cookies?                    Como \\u00e9 pr\\u00e1tica comum em quase todos os sites profissionais, este site usa cookies, que s\\u00e3o pequenos arquivos baixados no seu computador, para melhorar sua experi\\u00eancia. Esta p\\u00e1gina descreve quais informa\\u00e7\\u00f5es eles coletam, como as usamos e por que \\u00e0s vezes                        precisamos armazenar esses cookies. Tamb\\u00e9m compartilharemos como voc\\u00ea pode impedir que esses cookies sejam armazenados, no entanto, isso pode fazer o downgrade ou \'quebrar\' certos elementos da funcionalidade do site.                    Como usamos os cookies?                    Utilizamos cookies por v\\u00e1rios motivos, detalhados abaixo. Infelizmente, na maioria dos casos, n\\u00e3o existem op\\u00e7\\u00f5es padr\\u00e3o do setor para desativar os cookies sem desativar completamente a funcionalidade e os recursos que eles adicionam a este site. \\u00c9 recomend\\u00e1vel                        que voc\\u00ea deixe todos os cookies se n\\u00e3o tiver certeza se precisa ou n\\u00e3o deles, caso sejam usados \\u200b\\u200bpara fornecer um servi\\u00e7o que voc\\u00ea usa.                    Desativar cookies                    Voc\\u00ea pode impedir a configura\\u00e7\\u00e3o de cookies ajustando as configura\\u00e7\\u00f5es do seu navegador (consulte a Ajuda do navegador para saber como fazer isso). Esteja ciente de que a desativa\\u00e7\\u00e3o de cookies afetar\\u00e1 a funcionalidade deste e de muitos outros sites que                        voc\\u00ea visita. A desativa\\u00e7\\u00e3o de cookies geralmente resultar\\u00e1 na desativa\\u00e7\\u00e3o de determinadas funcionalidades e recursos deste site. Portanto, \\u00e9 recomend\\u00e1vel que voc\\u00ea n\\u00e3o desative os cookies.                    Cookies que definimos                                                                        Cookies relacionados \\u00e0 conta Se voc\\u00ea criar uma conta connosco, usaremos cookies para o gerenciamento do processo de inscri\\u00e7\\u00e3o e administra\\u00e7\\u00e3o geral. Esses cookies geralmente ser\\u00e3o exclu\\u00eddos quando voc\\u00ea sair do sistema, por\\u00e9m, em alguns                            casos, eles poder\\u00e3o permanecer posteriormente para lembrar as prefer\\u00eancias do seu site ao sair.                                                                            Cookies relacionados ao login Utilizamos cookies quando voc\\u00ea est\\u00e1 logado, para que possamos lembrar dessa a\\u00e7\\u00e3o. Isso evita que voc\\u00ea precise fazer login sempre que visitar uma nova p\\u00e1gina. Esses cookies s\\u00e3o normalmente removidos ou limpos                            quando voc\\u00ea efetua logout para garantir que voc\\u00ea possa acessar apenas a recursos e \\u00e1reas restritas ao efetuar login.                                                                            Cookies relacionados a boletins por e-mail Este site oferece servi\\u00e7os de assinatura de boletim informativo ou e-mail e os cookies podem ser usados \\u200b\\u200bpara lembrar se voc\\u00ea j\\u00e1 est\\u00e1 registrado e se deve mostrar determinadas notifica\\u00e7\\u00f5es                            v\\u00e1lidas apenas para usu\\u00e1rios inscritos \\/ n\\u00e3o inscritos.                                                                            Pedidos processando cookies relacionados Este site oferece facilidades de com\\u00e9rcio eletr\\u00f4nico ou pagamento e alguns cookies s\\u00e3o essenciais para garantir que seu pedido seja lembrado entre as p\\u00e1ginas, para que possamos process\\u00e1-lo adequadamente.                                    