INSERT INTO `wpro_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES (1,1,'2021-01-02 21:19:23','2021-01-02 21:19:23','<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->','Hello world!','','publish','open','open','','hello-world','','','2021-01-02 21:19:23','2021-01-02 21:19:23','',0,'https://oportunidadesonline.online/?p=1',0,'post','',1),(2,1,'2021-01-02 21:19:23','2021-01-02 21:19:23','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"https://oportunidadesonline.online/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','publish','closed','open','','sample-page','','','2021-01-02 21:19:23','2021-01-02 21:19:23','',0,'https://oportunidadesonline.online/?page_id=2',0,'page','',0),(5,1,'2021-01-02 22:29:40','0000-00-00 00:00:00','','Início','','draft','closed','closed','','','','','2021-01-02 22:29:40','0000-00-00 00:00:00','',0,'https://oportunidadesonline.online/?p=5',1,'nav_menu_item','',0),(6,1,'2021-01-02 22:29:40','0000-00-00 00:00:00',' ','','','draft','closed','closed','','','','','2021-01-02 22:29:40','0000-00-00 00:00:00','',0,'https://oportunidadesonline.online/?p=6',1,'nav_menu_item','',0),(9,1,'2021-01-03 12:27:02','2021-01-03 15:27:02','','internet-of-things','','inherit','open','closed','','internet-of-things','','','2021-01-03 12:27:02','2021-01-03 15:27:02','',0,'https://oportunidadesonline.online/wp-content/uploads/2021/01/internet-of-things.png',0,'attachment','image/png',0),(10,1,'2021-01-03 12:27:29','2021-01-03 15:27:29','','internet-of-things','','inherit','open','closed','','internet-of-things-2','','','2021-01-03 12:27:29','2021-01-03 15:27:29','',0,'https://oportunidadesonline.online/wp-content/uploads/2021/01/internet-of-things-1.png',0,'attachment','image/png',0),(11,1,'2021-01-03 12:28:58','2021-01-03 15:28:58','https://oportunidadesonline.online/wp-content/uploads/2021/01/cropped-internet-of-things-1.png','cropped-internet-of-things-1.png','','inherit','open','closed','','cropped-internet-of-things-1-png','','','2021-01-03 12:28:58','2021-01-03 15:28:58','',0,'https://oportunidadesonline.online/wp-content/uploads/2021/01/cropped-internet-of-things-1.png',0,'attachment','image/png',0),(13,1,'2021-01-03 12:32:16','2021-01-03 15:32:16','','digital-alarm-clock','','inherit','open','closed','','digital-alarm-clock','','','2021-01-03 12:32:16','2021-01-03 15:32:16','',0,'https://oportunidadesonline.online/wp-content/uploads/2021/01/digital-alarm-clock.png',0,'attachm