t','image/png',0),(63,1,'2021-01-17 12:08:10','2021-01-17 15:08:10','','Home','','publish','closed','closed','','home','','','2021-01-17 12:08:10','2021-01-17 15:08:10','',0,'https://oportunidadesonline.online/home/',0,'page','',0),(67,1,'2021-01-27 12:09:07','2021-01-27 15:09:07','{{unknown}}','','','publish','closed','closed','','6f2e5b0b40bd37941336e2a0314486b5','','','2021-01-27 12:09:07','2021-01-27 15:09:07','',0,'https://oportunidadesonline.online/2021/01/27/6f2e5b0b40bd37941336e2a0314486b5/',0,'oembed_cache','',0),(71,1,'2021-02-07 16:05:17','2021-02-07 19:05:17','{{unknown}}','','','publish','closed','closed','','6fad5704f479589e94513bc2f8f2dbe4','','','2021-02-07 16:05:17','2021-02-07 19:05:17','',0,'https://oportunidadesonline.online/2021/02/07/6fad5704f479589e94513bc2f8f2dbe4/',0,'oembed_cache','',0),(128,1,'2021-07-03 21:46:57','2021-07-04 00:46:57','<h2>Política Privacidade</h2>\r\nA sua privacidade é importante para nós. É política do Guugga respeitar a sua privacidade em relação a qualquer informação sua que possamos coletar no site <a href=\"www.oportunidadesonline.online\">Guugga</a>, e outros sites que possuímos e operamos.\r\n\r\nSolicitamos informações pessoais apenas quando realmente precisamos delas para lhe fornecer um serviço. Fazemo-lo por meios justos e legais, com o seu conhecimento e consentimento. Também informamos por que estamos coletando e como será usado.\r\n\r\nApenas retemos as informações coletadas pelo tempo necessário para fornecer o serviço solicitado. Quando armazenamos dados, protegemos dentro de meios comercialmente aceitáveis ​​para evitar perdas e roubos, bem como acesso, divulgação, cópia, uso ou modificação não autorizados.\r\n\r\nNão compartilhamos informações de identificação pessoal publicamente ou com terceiros, exceto quando exigido por lei.\r\n\r\nO nosso site pode ter links para sites externos que não são operados por nós. Esteja ciente de que não temos controle sobre o conteúdo e práticas desses sites e não podemos aceitar responsabilidade por suas respectivas <a href=\"https://politicaprivacidade.com\" target=\"_BLANK\" rel=\"noopener\">políticas de privacidade</a>.\r\n\r\nVocê é livre para recusar a nossa solicitação de informações pessoais, entendendo que talvez não possamos fornecer alguns dos serviços desejados.\r\n\r\nO uso continuado de nosso site será considerado como aceitação de nossas práticas em torno de privacidade e informações pessoais. Se você tiver alguma dúvida sobre como lidamos com dados do usuário e informações pessoais, entre em contacto connosco.\r\n<h2>Política de Cookies Guugga</h2>\r\n<h3>O que são cookies?</h3>\r\nComo é prática comum em quase todos os sites profissionais, este site usa cookies, que são pequenos arquivos baixados no seu computador, para melhorar sua experiência. Esta página descreve quais informações eles coletam, como as usamos e por que às vezes precisamos armazenar esses cookies. Também compartilharemos como você pode impedir que esses cookies sejam armazenados, no entanto, isso pode fazer o downgrade ou \'quebrar\' certos elementos da funcionalidade do site.\r\n<h3>Como usamos os cookies?</h3>\r\nUtilizamos cookies por vários motivos, detalhados abaixo. Infelizmente, na maioria dos casos, não existem opções padrão do setor para desativar os cookies sem desativar completamente a funcionalidade e os recursos que eles adicionam a este site. É recomendável que você deixe todos os cookies se não tiver certeza se precisa ou não deles, caso sejam usados ​​para fornecer um serviço que você usa.\r\n<h3>Desativar cookies</h3>\r\nVocê pode impedir a configuração de cookies ajustando as configurações do seu navegador (consulte a Ajuda do navegador para saber como fazer isso). Esteja ciente de que a desativação de cookies afetará a funcionalidade deste e de muitos outros sites que você visita. A desativação de cookies geralmente resultará na desativação de determinadas funcionalidades e recursos deste site. Portanto, é recomendável que você não desative os cookies.\r\n<h3>Cookies que definimos</h3>\r\n<ul>\r\n 	<li>Cookies relacionados à conta\r\n\r\nSe você criar uma conta connosco, usaremos cookies para o gerenciamento do processo de inscrição e administração geral. Esses cookies geralmente serão excluídos quando você sair do sistema, porém, em alguns casos, eles poderão permanecer posteriormente para lembrar as preferências do seu site ao sair.</li>\r\n 	<li>Cookies relacionados ao login\r\n\r\nUtilizamos cookies quando você está logado, para que possamos lembrar dessa ação. Isso evita que você precise fazer login sempre que visitar uma nova página. Esses cookies são normalmente removidos ou limpos quando você efetua logout para garantir que você possa acessar apenas a recursos e áreas restritas ao efetuar login.</li>\r\n 	<li>Cookies relacionados a boletins por e-mail\r\n\r\nEste site oferece serviços de assinatura de boletim informativo ou e-mail e os cookies podem ser usados ​​para lembrar se você já está registrado e se deve mostrar determinadas notificações válidas apenas para usuários inscritos / não inscritos.</li>\r\n 	<li>Pedidos processando cookies relacionados\r\n\r\nEste site oferece facilidades de comércio eletrônico ou pagamento e alguns cookies são essenciais para garantir que seu pedido seja lembrado entre as páginas, para que possamos processá-lo adequadamente.</li>\r\n 	<li>Cookies relacionados a pesquisas\r\n\r\nPeriodicamente, oferecemos pesquisas e questionários para fornecer informações interessantes, ferramentas úteis ou para entender nossa base de usuários com mais precisão. Essas pesquisas podem usar cookies para lembrar quem já participou numa pesquisa ou para fornecer resultados precisos após a alteração das páginas.</li>\r\n 	<li>Cookies relacionados a formulários\r\n\r\nQuando você envia dados por meio de um formulário como os encontrados nas páginas de contacto ou nos formulários de comentários, os cookies podem ser configurados para lembrar os detalhes do usuário para correspondência futura.</li>\r\n 	<li>Cookies de preferências do site\r\n\r\nPara proporcionar uma ótima experiência neste site, fornecemos a funcionalidade para definir suas preferências de como esse site é executado quando você o usa. Para lembrar suas preferências, precisamos definir cookies para que essas informações possam ser chamadas sempre que você interagir com uma página for afetada por suas preferências.</li>\r\n</ul>\r\n<h3>Cookies de Terceiros</h3>\r\nEm alguns casos especiais, também usamos cookies fornecidos por terceiros confiáveis. A seção a seguir detalha quais cookies de terceiros você pode encontrar através deste site.\r\n<ul>\r\n 	<li>Este site usa o Google Analytics, que é uma das soluções de análise mais difundidas e confiáveis ​​da Web, para nos ajudar a entender como você usa o site e como podemos melhorar sua experiência. Esses cookies podem rastrear itens como quanto tempo você gasta no site e as páginas visitadas, para que possamos continuar produzindo conteúdo atraente.</li>\r\n</ul>\r\nPara mais informações sobre cookies do Google Analytics, consulte a página oficial do Google Analytics.\r\n<ul>\r\n 	<li>As análises de terceiros são usadas para rastrear e medir o uso deste site, para que possamos continuar produzindo conteúdo atrativo. Esses cookies podem rastrear itens como o tempo que você passa no site ou as páginas visitadas, o que nos ajuda a entender como podemos melhorar o site para você.</li>\r\n 	<li>Periodicamente, testamos novos recursos e fazemos alterações subtis na maneira como o site se apresenta. Quando ainda estamos testando novos recursos, esses cookies podem ser usados ​​para garantir que você receba uma experiência consistente enquanto estiver no site, enquanto entendemos quais otimizações os nossos usuários mais apreciam.</li>\r\n 	<li>À medida que vendemos produtos, é importante entendermos as estatísticas sobre quantos visitantes de nosso site realmente compram e, portanto, esse é o tipo de dados que esses cookies rastrearão. Isso é importante para você, pois significa que podemos fazer previsões de negócios com precisão que nos permitem analizar nossos custos de publicidade e produtos para garantir o melhor preço possível.</li>\r\n</ul>\r\n<h3>Compromisso do Usuário</h3>\r\nO usuário se compromete a fazer uso adequado dos conteúdos e da informação que o Guugga oferece no site e com caráter enunciativo, mas não limitativo:\r\n<ul>\r\n 	<li>A) Não se envolver em atividades que sejam ilegais ou contrárias à boa fé a à ordem pública;</li>\r\n 	<li>B) Não difundir propaganda ou conteúdo de natureza racista, xenofóbica, ou casas de apostas (ex.:<a href=\"https://ondeapostar.pt/review/betano/\"> Betano</a>), jogos de sorte e azar, qualquer tipo de pornografia ilegal, de apologia ao terrorismo ou contra os direitos humanos;</li>\r\n 	<li>C) Não causar danos aos sistemas físicos (hardwares) e lógicos (softwares) do Guugga, de seus fornecedores ou terceiros, para introduzir ou disseminar vírus informáticos ou quaisquer outros sistemas de hardware ou software que sejam capazes de causar danos anteriormente mencionados.</li>\r\n</ul>\r\n<h3>Mais informações</h3>\r\nEsperemos que esteja esclarecido e, como mencionado anteriormente, se houver algo que você não tem certeza se precisa ou não, geralmente é mais seguro deixar os cookies ativados, caso interaja com um dos recursos que você usa em nosso site.\r\n\r\nEsta política é efetiva a partir de <strong>July</strong>/<strong>2021</strong>.','Políticas de Privacidade','','publish','closed','closed','','politicas-de-privacidade','','','2021-07-03 21:46:57','2021-07-04 00:46:57','',0,'https://oportunidadesonline.online/?page_id=128',0,'page','',0),(129,1,'2021-07-03 21:46:57','2021-07-04 00:46:57','<h2>Política Privacidade</h2>\r\nA sua privacidade é importante para nós. É política do Guugga respeitar a sua privacidade em relação a qualquer informação sua que possamos coletar no site <a href=\"www.oportunidadesonline.online\">Guugga</a>,